function displayThumbnails(e){let n=document.getElementById("thumbnail-container"),t="";t+='<div class="thumbnail-page">';for(let n=0;n<e.length;n++)t+=`\n      <a href="https://youtu.be/${e[n]}" target="_blank">\n        <img class="thumbnail"\n            src="https://i.ytimg.com/vi/${e[n]}/mqdefault.jpg" \n            alt="thumbnail"></a>\n    `,n%100==99?t+='</div><div class="thumbnail-page">':n%10==9&&(t+="<br>");n.innerHTML=t}function loadUploads(){document.getElementById("thumbnail-container").innerHTML='\n    <div class="text-center"><i class="fas fa-cog fa-3x fa-spin"></i></div>\n  ',requestSpreadsheetData("Input Data","Video List").then(e=>{let n=[];const t=getColumnHeaders(e);for(let a=e.length-1;a>=1;a--){const i=e[a],s=i[t["Video ID"]];n.push(s)}displayThumbnails(n),document.getElementById("error-container").className="d-none"}).catch(e=>{document.getElementById("thumbnail-container").innerHTML="",document.getElementById("error-container").className="d-block",document.getElementById("error-message").innerText=e.message})}function loadSignedIn(){document.getElementById("menu").innerHTML+='\n    <button class="btn btn-lg btn-primary mt-3" id="refresh-btn">Refresh Thumbnails</button>\n  ',document.getElementById("thumbnail-container").innerHTML='\n    <h5>No thumbnails are loaded. Press the "Refresh Thumbnails" button to view the thumbnails.</h5>\n  ',document.getElementById("about-list").innerHTML+='\n    <li>Thumbnails not loading? Try <a href="" id="signout-text">signing out</a> and signing back in.</li>\n    <li>\n      Missing some thumbnails? Make sure the missing videos are listed in the \n      <a href="https://docs.google.com/spreadsheets/d/1LNVjw5Hf2Ykp89jtxaX9itH5NOoudwaz0T74E7flZZg/edit#gid=485839191?usp=sharing"\n        target="_blank">"ADC Video Dashboard Input Data" Google Sheet</a>.\n    </li>\n  ';let e=document.getElementById("signout-text");e.addEventListener("click",handleSignout);let n=document.getElementById("refresh-btn");n.addEventListener("click",loadUploads),loadUploads()}